public class InnerSolutionHpoConfigFactory(Action<Humidifier.Personalize.SolutionTypes.HpoConfig> factoryAction = null) : SubResourceFactory<Humidifier.Personalize.SolutionTypes.HpoConfig>
{

    internal InnerSolutionHpoResourceConfigFactory HpoResourceConfigFactory { get; set; }

    internal InnerSolutionAlgorithmHyperParameterRangesFactory AlgorithmHyperParameterRangesFactory { get; set; }

    internal InnerSolutionHpoObjectiveFactory HpoObjectiveFactory { get; set; }

    protected override Humidifier.Personalize.SolutionTypes.HpoConfig Create()
    {
        var hpoConfigResult = CreateHpoConfig();
        factoryAction?.Invoke(hpoConfigResult);

        return hpoConfigResult;
    }

    private Humidifier.Personalize.SolutionTypes.HpoConfig CreateHpoConfig()
    {
        var hpoConfigResult = new Humidifier.Personalize.SolutionTypes.HpoConfig();

        return hpoConfigResult;
    }
    public override void CreateChildren(Humidifier.Personalize.SolutionTypes.HpoConfig result)
    {
        base.CreateChildren(result);

        result.HpoResourceConfig ??= HpoResourceConfigFactory?.Build();
        result.AlgorithmHyperParameterRanges ??= AlgorithmHyperParameterRangesFactory?.Build();
        result.HpoObjective ??= HpoObjectiveFactory?.Build();
    }

} // End Of Class

